import React from "react";
import { useSelector } from "react-redux";
export default function ReportList() {
    const Reports = useSelector(state => state.reports)
    return (
        <section>
            {Reports.map((item) =>{ 
                <div> 
                    <h1>{item.title}</h1>
                    <p>{item.text}</p>
                    </div>
            })}

        </section>
    );
}
